import React from 'react';

const ThemeHeadings = () => {
  const [fontFamilies, setFontFamilies] = useState([
    { id: BlueFont, fontDefault: 'Montserrat, sans-serif', fontStyle: 'Ranchers, display' },
    { id: OrangeFont, font: 'Ranchers, display' },
    { id: fontAccent, font: 'Licorice, handwriting' },
  ]);
  return (
    <>
      <div className='containerFluid1 container1-lg'>
        <div className='mainTitle pb2'>
          <h5 className='fontStyle fsH3'>Font Family:</h5>
        </div>

        <div className='headingsNames sectionTitle'>
          <div className='fontDefault fsMD pb1'>
            <h6 className='fsMD'>.fontDefault:</h6>
            <p className='fsSM'>font-family: 'Montserrat, sans-serif'</p>
          </div>
          <div className='fontStyle fsMD pb1'>
            <h6 className='fsMD'>.fontStyle:</h6>
            <p className='fsSM'>font-family: 'Ranchers, display'</p>
          </div>
          <div className='fontAccent pb1'>
            <h6 className='fsMD'>.fontAccent:</h6>
            <p className='fsSM'>font-family: 'Licorice, handwriting'</p>
          </div>
        </div>
      </div>
    </>
  );
};

export default ThemeHeadings;
